import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";

function Contact() {
    return (
        <div>
            <Header />
            <h1>Contact</h1>
            <ul>
                <li><a href="https://github.com/seahopki12" target="_blank">GitHub</a></li>
                <li><a href="https://linkedin.com/in/seahopki12" target="_blank">Linkedin</a></li>
                <li>
                    <span>Email Address: </span><a href="mailto:seahopki12@gmail.com">seahopki12@gmail.com</a>
                </li>
                <li>
                    <span>Phone Number: </span><a href="tel:17573278855">(757)327-8855</a>
                </li>
            </ul>
            <Footer />
        </div>
    )
}

export default Contact;
